import React, { Component } from 'react';
import './inc.css';


class inc extends Component {

  yellow() {
        console.log(yellow);
    }

  render() {
    return (
      <div className="inc">

        <div class="inc-box">
          hello

          <div class="x-inc" onClick={()=>{ test(); }}> <i class="fas fa-times xinc"></i> </div>

        </div>

        <div className="yellow"></div>

      </div>
    );
  }
}

export default inc;
